INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 122601, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 105, 101, 1, 1, 160, 1.5, 0, 110, 0.029);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 122401, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2, 111, 102, 0, 3, 120, 2.5, 1, 105, 0.014);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 122501, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 3, 105, 103, 0, 2, 350, 2.5, 0, 110, 0.017);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 107501, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 4, 105, 104, 0, 3, 130, 1.5, 1, 110, 0.016);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 107601, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 5, 105, 105, 1, 1, 160, 2.5, 0, 110, 0.014);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 107801, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 6, 103, 106, 0, 2, 255, 3.5, 0, 120, 0.029);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 110601, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 7, 103, 107, 1, 1, 160, 3.5, 0, 120, 0.013);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 110401, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 8, 103, 108, 0, 2, 350, 2.5, 0, 110, 0.014);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 110501, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 9, 100, 109, 0, 3, 130, 1.5, 1, 105, 0.012);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 115701, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 10, 103, 110, 1, 1, 200, 2.5, 0, 105, 0.014);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 113601, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 11, 103, 111, 0, 2, 350, 2.5, 0, 105, 0.071);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 107901, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 12, 103, 112, 0, 3, 130, 1.5, 1, 120, 0.014);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 108001, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 13, 105, 113, 1, 2, 200, 1.5, 0, 110, 0.022);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 110301, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 14, 108, 114, 1, 1, 160, 2.5, 0, 110, 0.031);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 107701, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 15, 105, 115, 0, 1, 130, 0.5, 1, 110, 0.036);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 113101, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 16, 95, 116, 0, 2, 350, 3.5, 0, 110, 0.048);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 113301, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 17, 105, 117, 0, 3, 130, 1.5, 1, 105, 0.043);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 113201, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 18, 95, 118, 0, 2, 130, 1.5, 1, 105, 0.018);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 117001, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 19, 108, 119, 1, 2, 160, 2.5, 0, 110, 0.021);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 113501, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 20, 105, 120, 0, 1, 255, 2.5, 0, 110, 0.036);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 113401, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 21, 105, 121, 0, 3, 350, 2.5, 0, 105, 0.02);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 110101, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 22, 105, 122, 0, 1, 130, 2.5, 1, 110, 0.018);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 110001, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 23, 111, 123, 1, 3, 160, 3.5, 0, 105, 0.03);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 117201, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 24, 103, 124, 0, 1, 130, 1.5, 1, 110, 0.027);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 117301, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 25, 108, 125, 1, 2, 160, 3.5, 0, 105, 0.02);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 117401, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 26, 105, 126, 0, 3, 350, 2.5, 0, 110, 0.04);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 117101, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 27, 105, 127, 0, 1, 350, 3.5, 0, 110, 0.009);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 122901, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 28, 105, 128, 0, 1, 255, 3.5, 0, 120, 0.022);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 122801, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 29, 105, 129, 0, 3, 130, 2.5, 1, 110, 0.028);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 122701, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 30, 108, 130, 1, 2, 130, 3.5, 0, 105, 0.023);
